import { withFilter } from 'apollo-server';
import { SubscriptionTypes } from '../resolvers';

const annotationChanged = {
  subscribe: withFilter(
    (p, args, context) => context.pubsub.asyncIterator(SubscriptionTypes.ANNOTATION_CHANGED),
    // only trigger events if the annotation belongs to the document that the user subscribed to
    (payload, variables) => {
      const { userId } = variables;
      const { userId: forUser } = payload;
      if (forUser === userId) return true;
      return false;
    }
  )
};

const documentChanged = {
  subscribe: withFilter(
    (p, args, context) => {
      return context.pubsub.asyncIterator(SubscriptionTypes.DOCUMENT_CHANGED);
    },
    (payload, variables) => {
      const { userId } = variables;
      const { userId: forUser } = payload;
      return forUser === userId;
    }
  )
};
const scrollPositionChanged = {
  subscribe: withFilter(
    (p, args, context) => {
      return context.pubsub.asyncIterator(SubscriptionTypes.SCROLL_POSITION_CHANGED);
    },
    async (payload, variables) => {
      const { documentId } = payload.scrollPositionChanged;
      const { docId: subscriptionDocId } = variables;
      return documentId === subscriptionDocId;
    }
  )
};

const connectedDocUsersChanged = {
  subscribe: withFilter(
    (p, args, context) => {
      return context.pubsub.asyncIterator(SubscriptionTypes.CONNECTED_DOC_USERS_CHANGED);
    },
    async (payload, variables) => {
      const { documentId } = payload.connectedDocUsersChanged;
      const { docId: subscriptionDocId } = variables;
      return documentId === subscriptionDocId;
    }
  )
};

const mentionChanged = {
  subscribe: withFilter(
    (p, args, context) => {
      return context.pubsub.asyncIterator(SubscriptionTypes.MENTION_CHANGED);
    },
    (payload, variables) => {
      const { userId } = variables;
      const { userId: forUser } = payload;
      return forUser === userId;
    }
  )
}

export default {
  annotationChanged,
  documentChanged,
  scrollPositionChanged,
  connectedDocUsersChanged,
  mentionChanged,
};
